import React, { useEffect, useState } from 'react'
import "./Pages.css";

const Computers = () => {
  const [computerData, setComputerData]=useState()
  useEffect(()=>{
    const fetchData=async()=>{
      try{
        const response= await fetch('Next-Store/db.json');
        const data=await response.json();
        setComputerData(data);
      }
      catch(error){
        console.error
      }
    }
  })
  return (
    <div className='telephones'>
      <div className="left">
        <ul>
          <li><strong>Brendl…ôr</strong></li>
          <li>HP</li>
          <li>Deel</li>
          <li>Apple </li>
          <li>Asus</li>
          <li>Acer</li>
          <li>Lenovo</li>
          <li>Toshiba</li>
          <li>MSI</li>
          <li>Monster</li>
          <li>Razer</li>
          <li>Casper</li>
          <li>Microsoft Surface</li>
        </ul>
      </div>
      <div className="right">
      <ul>
          <li><strong>HP</strong></li>
          <li> 15cs-2073cl</li>
          <li>Compaq cq58</li>
          <li>20</li>
          <li>Envy</li>
          </ul>
      </div>

    </div>
  )
}

export default Computers
